import React from 'react';

const data = [
    {
      title:'Macbook 13',
      text:'15tys',
      image: macimg1,
      price:715,
    },
    {
      title:'Macbook 15',
      text:'lml',
      image: macimg2,
      price:715,
    }
  ]


function Catalog() {
    return (
      <div style={{width:'auto', height:'auto', backgroundColor:'black'}}>
        <CardWrapper>
      {data.map(({ title, text, image, price }, idx) => (
        <CardItem
          title={title}
          text={text}
          imageSrc={image}
          price={price}
          id={idx}
        />
      ))}
    </CardWrapper>

      </div>
    );
  }

  export default Catalog;
